/** @format */

import React from "react";
import Comman from "./Comman";
import Spiderman from "./imgs/spiderman.png";

const Home = (props) => {
  return (
    <>
      <Comman h1={"Grow your business with " + props.t} imgsrc={Spiderman} />
    </>
  );
};
export default Home;
